import React from 'react';
import {Route, Switch} from 'react-router-dom'

import Home from '../views/Home'

function Router(props) {
    return (
        <Switch>
            <Route path="/">
                <Home/>
            </Route>
        </Switch>
    );
} 

export default Router;
